import React, { Component } from "react";
import PokemonList from "../pokemon/PokemonList";
import SearchBar from "./SearchBar";

export default class Dashboard extends Component {
  render() {
    return (
      <React.Fragment>
        <div className="row">
          <div className="col-md-3" />
          <SearchBar />
        </div>
        <p />
        <div className="row">
          <div className="col">
            <PokemonList />
          </div>
        </div>
      </React.Fragment>
    );
  }
}
